import React, { useState } from "react";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import { createStyles, makeStyles, Theme } from "@material-ui/core/styles";
import { Grid } from "@material-ui/core";
import CreateOrderAPI from "../../components/createorder/create-order";
const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            padding: "3rem",
        },
        form: {
            width: "100%",
        },
        input: {
            margin: "20px 0",
            "& input:valid + fieldset": {
                borderColor: "#008fe5",
                borderWidth: 1,
            },
            "& input:focus + fieldset": {
                borderColor: "#008fe5 !important",
                borderWidth: 1,
            },
            "& input:invalid + fieldset": {
                borderColor: "#ff6767",
                borderWidth: 1,
            },
        },

        margin: {
            margin: theme.spacing(1),
        },

        pay: {
            padding: "16px 0",
            boxShadow: "none",
            backgroundColor: "#fc820d",
            color: "#f9f9f9",
            "&:hover": {
                boxShadow: "none",
                backgroundColor: "#008fe5",
                color: "#f9f9f9",
            },
        },
    })
);


function OrderPage() {
    const classes = useStyles();
    const [result, setResult] = useState<string>("");
    async function handleOrder() {
        const orderAPI = await CreateOrderAPI();
        console.log("orderAPI: ", JSON.stringify(orderAPI, null, 2));
        // @ts-ignore
        window.location.href = orderAPI["order_url"].toString();
    }


    return (
        <Grid
            container
            direction="column"
            justify="flex-start"
            alignItems="center"
            className={classes.root}
        >
            <form
                noValidate
                autoComplete="off"
                className={classes.form}
                >

                <Button variant={"outlined"}
                    style={{margin: "100 auto"}}
                    className={classes.pay}

                    onClick={() => handleOrder()}> CreateOrder
                </Button>
            </form>

        <p style={{ paddingTop: "20px", color: "#737373" }}>{result}</p>
        </Grid>

    )

}

export default OrderPage
